template<typename T>
void swapf(T& x, T& y)
{
    T tmp;

    tmp = x;
    x = y;
    y = tmp;
}

template<typename T>
void swapi(T& x, T& y)
{
    T tmp;

    tmp = x;
    x = y;
    y = tmp;
}

template<typename T>
void sort(T* A, int n, unsigned* col_id) {
    int  arrayLength = n;
    bool oddSorted = false;//if false, then, 奇數次，依然有的排
    bool evenSorted = false;//if false, then, 偶數次，依然有的排

    for (unsigned idx = 0; idx < n; idx++) {
        col_id[idx] = idx;
    }

    while (!oddSorted || !evenSorted) {
        int base = 0;
        oddSorted = true;
        evenSorted = true;

        for (int i = base; i < arrayLength - 1; i += 2) {
            if (A[i] > A[i + 1]) {
                swapf(A[i], A[i + 1]);
                swapi(col_id[i], col_id[i + 1]);
                oddSorted = false;
            }
        }

        base = 1;
        for (int i = base; i < arrayLength - 1; i += 2) {
            if (A[i] > A[i + 1]) {
                swapf(A[i], A[i + 1]);
                swapi(col_id[i], col_id[i + 1]);
                evenSorted = false;
            }
        }
    }
}
